import { useState } from "react"

export const TicketPlayground = () => {

	const defText = ` 
		kitchen:"cocina",
		date: "27/12/2021",
		time : "21:30",
		waiter : "luciano",
		table : "23",
		`

	const [textArea, setTextArea] = useState(defText)

	const handleTextArea = event => {
		setTextArea(event.target.value)
	}


  return (
    <div>
      <h3>Playground</h3>

			{["kitchen","date", "time", "waiter", "table"].map(input => {
				<input type="text" value={input} name={input}/>
			})}


    </div>
  );
}
